import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

const Profile = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [activeTab, setActiveTab] = useState('info');
  const [editMode, setEditMode] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    phone: ''
  });

  // Get user from localStorage on component mount
  useEffect(() => {
    const loggedInUser = localStorage.getItem('user');

    if (!loggedInUser) {
      navigate('/login');
      return;
    }

    const userData = JSON.parse(loggedInUser);
    setUser(userData);
    setFormData({
      name: userData.name,
      phone: userData.phone || ''
    });

    // Fetch user profile data from API
    fetchUserData(userData.id);
  }, [navigate]);

  const fetchUserData = async (userId) => {
    setLoading(true);
    try {
      const response = await axios.get(`/api/users/${userId}`);
      setUser(response.data.data.user);
      setBookings(response.data.data.bookings || []);

      // Update localStorage with latest user data
      localStorage.setItem('user', JSON.stringify(response.data.data.user));

      setFormData({
        name: response.data.data.user.name,
        phone: response.data.data.user.phone || ''
      });
    } catch (err) {
      console.error('Error fetching user data:', err);
      setError('Failed to load profile data');
    } finally {
      setLoading(false);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const response = await axios.put(`/api/users/${user.id}`, formData);
      setUser(response.data.data.user);

      // Update localStorage with latest user data
      localStorage.setItem('user', JSON.stringify(response.data.data.user));

      setEditMode(false);
    } catch (err) {
      console.error('Error updating profile:', err);
      setError('Failed to update profile');
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/login');
  };

  const formatDate = (dateString) => {
    const options = { year: 'numeric', month: 'long', day: 'numeric' };
    return new Date(dateString).toLocaleDateString(undefined, options);
  };

  if (loading && !user) {
    return (
      <div className="container mt-5 text-center">
        <div className="spinner-border text-primary" role="status">
          <span className="visually-hidden">Loading...</span>
        </div>
        <p className="mt-3">Loading profile...</p>
      </div>
    );
  }

  return (
    <div className="container my-5">
      <div className="row">
        <div className="col-lg-3 mb-4">
          <div className="card shadow-sm">
            <div className="card-body text-center">
              <div className="mb-3">
                <div className="avatar-circle mx-auto">
                  <span className="avatar-initials">
                    {user?.name?.charAt(0) || 'U'}
                  </span>
                </div>
              </div>
              <h5 className="card-title">{user?.name}</h5>
              <p className="text-muted">{user?.email}</p>
              <p className="text-muted small">
                Member since {formatDate(user?.createdAt)}
              </p>
              <button 
                className="btn btn-outline-danger btn-sm w-100 mt-3"
                onClick={handleLogout}
              >
                <i className="bi bi-box-arrow-right me-2"></i>
                Logout
              </button>
            </div>
          </div>
        </div>

        <div className="col-lg-9">
          {error && (
            <div className="alert alert-danger mb-4" role="alert">
              <i className="bi bi-exclamation-triangle me-2"></i>
              {error}
            </div>
          )}

          <div className="card shadow-sm">
            <div className="card-header bg-white">
              <ul className="nav nav-tabs card-header-tabs">
                <li className="nav-item">
                  <button 
                    className={`nav-link ${activeTab === 'info' ? 'active' : ''}`}
                    onClick={() => setActiveTab('info')}
                  >
                    <i className="bi bi-person me-2"></i>
                    Personal Information
                  </button>
                </li>
                <li className="nav-item">
                  <button 
                    className={`nav-link ${activeTab === 'bookings' ? 'active' : ''}`}
                    onClick={() => setActiveTab('bookings')}
                  >
                    <i className="bi bi-calendar-check me-2"></i>
                    Booking History
                    {bookings.length > 0 && (
                      <span className="badge bg-primary ms-2">{bookings.length}</span>
                    )}
                  </button>
                </li>
              </ul>
            </div>

            <div className="card-body">
              {activeTab === 'info' && (
                <div>
                  <div className="d-flex justify-content-between align-items-center mb-4">
                    <h4 className="card-title mb-0">Personal Information</h4>
                    {!editMode && (
                      <button 
                        className="btn btn-primary btn-sm"
                        onClick={() => setEditMode(true)}
                      >
                        <i className="bi bi-pencil me-2"></i>
                        Edit Profile
                      </button>
                    )}
                  </div>

                  {editMode ? (
                    <form onSubmit={handleSubmit}>
                      <div className="mb-3">
                        <label htmlFor="name" className="form-label">Full Name</label>
                        <input
                          type="text"
                          className="form-control"
                          id="name"
                          name="name"
                          value={formData.name}
                          onChange={handleChange}
                          required
                        />
                      </div>

                      <div className="mb-3">
                        <label htmlFor="email" className="form-label">Email address</label>
                        <input
                          type="email"
                          className="form-control"
                          id="email"
                          value={user.email}
                          disabled
                        />
                        <div className="form-text">Email address cannot be changed</div>
                      </div>

                      <div className="mb-3">
                        <label htmlFor="phone" className="form-label">Phone Number</label>
                        <input
                          type="tel"
                          className="form-control"
                          id="phone"
                          name="phone"
                          value={formData.phone}
                          onChange={handleChange}
                        />
                      </div>

                      <div className="d-flex gap-2">
                        <button 
                          type="submit" 
                          className="btn btn-success"
                          disabled={loading}
                        >
                          {loading ? 'Saving...' : 'Save Changes'}
                        </button>
                        <button 
                          type="button" 
                          className="btn btn-outline-secondary"
                          onClick={() => {
                            setEditMode(false);
                            setFormData({
                              name: user.name,
                              phone: user.phone || ''
                            });
                          }}
                        >
                          Cancel
                        </button>
                      </div>
                    </form>
                  ) : (
                    <div className="row">
                      <div className="col-md-6">
                        <ul className="list-group list-group-flush">
                          <li className="list-group-item">
                            <div className="fw-bold">Full Name</div>
                            {user.name}
                          </li>
                          <li className="list-group-item">
                            <div className="fw-bold">Email</div>
                            {user.email}
                          </li>
                          <li className="list-group-item">
                            <div className="fw-bold">Phone</div>
                            {user.phone || 'Not provided'}
                          </li>
                        </ul>
                      </div>
                    </div>
                  )}
                </div>
              )}

              {activeTab === 'bookings' && (
                <div>
                  <h4 className="card-title mb-4">Your Booking History</h4>

                  {loading ? (
                    <div className="text-center py-4">
                      <div className="spinner-border text-primary" role="status">
                        <span className="visually-hidden">Loading...</span>
                      </div>
                      <p className="mt-3">Loading bookings...</p>
                    </div>
                  ) : bookings.length === 0 ? (
                    <div className="alert alert-info">
                      <i className="bi bi-info-circle me-2"></i>
                      You don't have any bookings yet. 
                      <Link to="/tours" className="alert-link ms-2">Browse tours</Link>
                    </div>
                  ) : (
                    <div className="table-responsive">
                      <table className="table table-hover">
                        <thead>
                          <tr>
                            <th>Booking ID</th>
                            <th>Tour</th>
                            <th>Date</th>
                            <th>Guests</th>
                            <th>Total</th>
                            <th>Status</th>
                          </tr>
                        </thead>
                        <tbody>
                          {bookings.map(booking => (
                            <tr key={booking._id}>
                              <td>#{booking._id}</td>
                              <td>
                                {booking.tourTitle || booking.tour?.title || 'Unknown Tour'}
                                <div className="small text-muted">
                                  {booking.tourLocation || booking.tour?.location || ''}
                                </div>
                              </td>
                              <td>{formatDate(booking.date)}</td>
                              <td>{booking.participants || booking.guests}</td>
                              <td>${booking.totalPrice || (booking.price * (booking.participants || booking.guests))}</td>
                              <td>
                                <span className="badge bg-success">
                                  {booking.status || 'Confirmed'}
                                </span>
                              </td>
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                  )}
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
